CREATE TABLE prodavnica(
	id_prodavnica INT NOT NULL,
	mesto VARCHAR(10) NOT NULL,
	adresa VARCHAR(50) NOT NULL,
	velicina FLOAT NOT NULL,
	PRIMARY KEY (id_prodavnica, mesto)
) PARTITION BY LIST (mesto);



CREATE TABLE prodavnica_nis PARTITION OF prodavnica FOR VALUES IN ('Nis');

CREATE TABLE prodavnica_beograd PARTITION OF prodavnica FOR VALUES IN ('Beograd');

CREATE TABLE prodavnica_kragujevac PARTITION OF prodavnica FOR VALUES IN ('Kragujevac');

CREATE TABLE prodavnica_cacak PARTITION OF prodavnica FOR VALUES IN ('Cacak');

CREATE TABLE prodavnica_leskovac PARTITION OF prodavnica FOR VALUES IN ('Leskovac');

CREATE TABLE prodavnica_subotica PARTITION OF prodavnica FOR VALUES IN ('Subotica');

CREATE TABLE prodavnica_novi_sad PARTITION OF prodavnica FOR VALUES IN ('Novi Sad');






CREATE TABLE proizvod(
	id_proizvod INT PRIMARY KEY,
	naziv VARCHAR(50) NOT NULL,
	cena FLOAT NOT NULL,
	kolicina INT NOT NULL,
	fk_prodavnica INT NOT NULL,
	fk_mesto VARCHAR(10) NOT NULL,
	FOREIGN KEY (fk_prodavnica, fk_mesto) REFERENCES prodavnica(id_prodavnica, mesto)
);





create table korisnik (
	id_korisnik INT,
	ime VARCHAR(50),
	prezime VARCHAR(50),
	username VARCHAR(50),
	password VARCHAR(50),
	bodovi INT,
	fk_prodavnica INT
);


create table mejl (
	id_mejl INT,
	adresa VARCHAR(50),
	fk_korisnik INT
);



create table telefon (
	id_telefon INT,
	broj VARCHAR(50),
	fk_korisnik INT
);

